/*Table structure for table `staff_upload` */

DROP TABLE IF EXISTS `staff_upload`;

CREATE TABLE `staff_upload` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `staff_id` int(11) NOT NULL,
  `image` varchar(255) NOT NULL,
  `lat_long` varchar(255) DEFAULT NULL,
  `creation_datetime` datetime DEFAULT NULL,
  `modification_datetime` datetime DEFAULT NULL,
  `deletion_datetime` datetime NOT NULL,
  `is_deleted` int(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

